INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 104711, 28414073, "おめでとう、マツリちゃん。\n私たちだけではなく、\n少年も一緒に準備してくれたんだよ。", 0, 1, 0, 1, 28414, 0.5);
