INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 100611, 31114081, "え～、プリンなんて食べたら\nなくなっちゃうよ～？\nアクセサリーとかの方がいいかな？", 0, 1, 0, 1, 31114, 0.5);
