INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 100711, 34314071, "ついにこの日がやってきたの～！\n今日はミヤコの誕生日なんだから、\n山のようにプリンを用意して、\n盛大にお祝いするの～♪", 0, 1, 0, 1, 34314, 0.5);
