INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 100611, 34314076, "もちろん、甘々で、プルプルのプリンを\nたくさん用意してきたよ～♪\n一度に頬張ったら、お口から\n垂れてきちゃうかも～♪", 0, 1, 0, 1, 34314, 0.5);
INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (91, "", 0, 34314077, "", "", "", "", "", 34314, "");
