INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 103111, 34314091, "でも、喜んでもらえてなによりです。\nミヤコさんが明るく振る舞う限り、\n穢れのない魂のまま、\n悪霊に転じることもないでしょう……", 0, 1, 0, 1, 34314, 0.5);
