INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 103311, 38214075, "いや、そんなことねぇよ！？\n祝ってもらってすごくうれしいけんど、\nその気持ちをどんな素晴らしいギャグで\n表現すべきか悩んでんだべ……", 0, 1, 0, 1, 38214, 0.5);
