INSERT INTO `v1_488ec963264b3cbf4896e4f1b778c4c502d33e1012f86291f0abe8b9187f090f` VALUES (11, 10, 100911, 38614084, "ああ、ミツキの年の数だけ\nロウソクを買ったつもりが、\nいざ実際の年齢を確認してみたら\n思ったより余ってしまって……", 0, 1, 0, 1, 38614, 0.5);
